import './App.css';
import {P} from './P';

const express = require('express')
const app = express()

app.get('/', function (req, res) {
  res.send('Hello World')
})

app.listen(3000)


function App() {
  return (
    <div>
     <P text="hi"/>
    </div>
  );
}

export default App;
